// Function to hash a string to a number
function hashString(str) {
  let hash = 0;
  if (str.length === 0) return hash;
  for (let i = 0; i < str.length; i++) {
    const char = str.charCodeAt(i);
    hash = ((hash << 5) - hash) + char;
    hash = hash & hash; // Convert to 32-bit integer
  }
  return Math.abs(hash);
}

// Function to get a deterministic SVG pattern based on website name
function getRandomSvgPattern() {
  // Filter out empty patterns
  const nonEmptyPatterns = svgPatterns.filter(pattern => pattern.trim() !== '');
  
  if (nonEmptyPatterns.length === 0) {
    return ''; // Return empty string if no valid patterns
  }
  
  // Get the website path or use a default
  const websitePath = window.location.pathname || '/';
  
  // Hash the website path to get a consistent index
  const hash = hashString(websitePath);
  const patternIndex = hash % nonEmptyPatterns.length;
  
  return nonEmptyPatterns[patternIndex];
}

// Function to display the SVG pattern
function displayRandomSvgPattern() {
  const patternContainer = document.getElementById('svg-pattern-container');
  if (patternContainer) {
    patternContainer.innerHTML = getRandomSvgPattern();
  }
}

// Auto-execute when DOM is loaded
document.addEventListener('DOMContentLoaded', displayRandomSvgPattern);
